import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  template: `
    <app-settings (onStart)="onStart($event)"></app-settings>

    <a routerLink="/game">Start</a>
    <router-outlet></router-outlet>
  `,
  styles: [
    `
      :host {
        display: flex;
        justify-content: center;
        align-items: center;
        height: 100vh;
      }

      .board {
        width: 500px;
        height: 500px;
      }
    `,
  ],
})
export class AppComponent {
  onStart = (settings: { x: number; y: number }) => {
    console.log(settings);
  }
}
